        "### Function for calculating the $\\Delta\\varphi_j(x)= \\frac{-4c^2 (c^4 - c^2 r^2 - r^4) }{(c^2-r^2)^4}\\exp\\{((r/c)^2-1 )^{-1}\\}$ values"
